import '././App.css';

function MainContent({arrayItems}){


    const changeUserValue = (e)=> {
        const { value } = e.target;
        arrayItems(value);
    }

    return (
        <main className="main">
            {
                arrayItems.map((item) => (
                    <div className="shop-title" key={item.nameItem}>
                        <p>{item.nameItem}</p>
                        <p>{item.model}</p>
                    </div>
                ))
            }
        </main>
    )
}

export default MainContent;
